const Hello = (props) => {
  return (
    <p>Hello {props.name}!</p>
  )
}

const App = () => {
  return (
    <div>
      <h1>Greetings</h1>
      <Hello name = "Jesse"/>
      <Hello />
      <Hello />
    </div>
  )
}

export default App;
